#include <iostream>
using namespace std;

class Solution {
public:
    bool isMatch(string s, string p) {
        int l1 = (int)s.length();
        int l2 = (int)p.length();
        if (l2 - count(p.begin(), p.end(), '*') > l1)
            return false;

        bool m[l1+1];
        memset(m+1, false, l1);
        m[0] = true;

        for (int j = 0; j < l2; j++) {
            if (p[j] == '*') {
                for (int i = 1; i <= l1; i++) {
                    m[i] = m[i-1] || m[i];
                }
            } else {
                for (int i = l1; i > 0; i--) {
                    m[i] = m[i-1] && (s[i-1] == p[j] || p[j] == '?');
                }
                m[0] = false;
            }
        }
        return m[l1];
    }
};

int main(int arg, char *argv[]) {
    // insert code here...
    cout << "LeetCode 044 Wildcard Matching, C++ ...\n\n";

    /*
    isMatch("aa","a") → false
    isMatch("aa","aa") → true
    isMatch("aaa","aa") → false
    isMatch("aa", "*") → true
    isMatch("aa", "a*") → true
    isMatch("ab", "?*") → true
    isMatch("aab", "c*a*b") → false
     */

    string s = "babaaababaabababbbbbbaabaabbabababbaababbaaabbbaaab";
    string p = "***bba**a*bbba**aab**b";

    s = "aaabbbaabaaaaababaabaaabbabbbbbbbbaabababbabbbaaaaba";
    p = "a*******b";

   s = "babbbbaabababaabbababaababaabbaabababbaaababbababaaaaaabbabaaaabababbabbababbbaaaababbbabbbbbbbbbbaabbb";
    p = "b**bb**a**bba*b**a*bbb**aba***babbb*aa****aabb*bbb***a";


    s = "";
    p = "**";


    Solution sol;
    bool res = sol.isMatch(s, p);
    cout << (res ? "true" : "false");


    return 0;
}